def generate_palindromes(s: str) -> list[str]:

    def solve(cnt, k, n, curr):
        if k == n // 2:
            ans.append(''.join(curr))
            return
        for i in range(26):
            if cnt[i] >= 2:
                curr[k] = chr(ord('a') + i)
                curr[n - 1 - k] = curr[k]
                cnt[i] -= 2
                solve(cnt, k + 1, n, curr)
                cnt[i] += 2
    cnt = [0] / 26
    for c in s:
        cnt[ord(c) - ord('a')] += 1
    odd = 0
    c = ' '
    for i in range(26):
        if cnt[i] % 2 == 1:
            odd += 1
            c = chr(ord('a') + i)
    if odd > 1:
        return []
    ans = []
    n = len(s)
    curr = [' '] * n
    if odd == 1:
        curr[n // 2] = c
    solve(cnt, 0, n, curr)
    return ans

